Mencoba menjawab:

Data gudang bisa di buat table terpisah, contoh:

gudang {id, gudang}
transaksi {id, tanggal, id_unit, id_gudang}
masuk {id_transaksi, penyedia}
keluar {id_transaksi, pembeli}
persediaan {id_transaksi, id_barang, jumlah, harga}

Nah, saat perhitungan dengan windows function, pisahkan masing-masing gudang dengan perintah:

PARTITION BY id_gudang

Demikian dari saya, semoga bermanfaat

Betul, itu sekedar contoh saja, dibawah ini contoh lain untuk memudahkan perpindahan antar gudang:

gudang {id, gudang}
transaksi {id, tanggal}
masuk {id_transaksi, id_penyedia, id_gudang}
keluar {id_transaksi, id_pembeli, id_gudang}
persediaan {id_transaksi, id_barang, jumlah, harga}

Sehingga bisa di buat menu distribusi, yaitu masuk dan keluar dalam satu transaksi. Jadi, saat entry pada table persediaan, otomatis data masuk dan keluar nya sama antar gudang yang dituju.

Mohon maaf, ini sekedar contoh design, sehingga belum tentu sesuai dengan kebutuhan sebenarnya. Silahkan di sesuaikan.

